import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlaneSlash, faXmark } from "@fortawesome/free-solid-svg-icons";
import ModalStyled from "./ModalStyled";
import { useAppDispatch } from "../../store/hooks";
import { closeModalActionCreator } from "../../store/reducer/uiSlice/uiSlice";
import { useCallback, useEffect } from "react";

interface ModalProps {
  text: string;
  type: string;
}
const Modal = ({ text, type }: ModalProps) => {
  const dispatch = useAppDispatch();

  const handleClose = useCallback(() => {
    dispatch(closeModalActionCreator());
  }, [dispatch]);

  useEffect(() => {
    const timer = setTimeout(() => {
      handleClose();
    }, 5000);
    return () => {
      clearTimeout(timer);
    };
  }, [handleClose]);

  const isErrorModal = type === "error";

  return (
    <>
      {isErrorModal ? (
        <ModalStyled className="modal">
          <FontAwesomeIcon
            icon={faXmark}
            className="modal__icon-cross"
            data-testid="icon-cross"
            onClick={handleClose}
          />
          <FontAwesomeIcon
            icon={faPlaneSlash}
            className="modal__icon-plane"
            data-testid="icon-plane"
          />
          <span className="modal__text">{text}</span>
        </ModalStyled>
      ) : (
        <ModalStyled className="modal">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            version="1.2"
            viewBox="0 0 940 788"
            width="450"
            height="450"
            className="modal-icon-world"
            data-testid="icon-world"
          >
            <defs>
              <image
                width="940"
                height="788"
                id="img1"
                href="data:image/png;base64,"
              />
            </defs>
            <style />
            <use href="#img1" x="0" y="0" />
          </svg>
          <span className="modal__text">{text}</span>
        </ModalStyled>
      )}
    </>
  );
};

export default Modal;
